--=======================================================
--This file contains statements to run that are valid
--for any On-Prem SQL Server version 13.0 (2016) and above
--=======================================================

--Starting with 2016, by default users are not allowed to create assemblies 
--without disabling clr strict security (unless a number of things are done
--such as signing the assembly with a certificate/asymmetric key that has a
--corresponding login with the UNSAFE ASSEMBLY permission on the server)
IF EXISTS(SELECT 1 FROM sys.configurations WHERE NAME='clr strict security')
BEGIN
    exec sp_configure 'show advanced options', '1'
    reconfigure
    EXEC sp_configure 'clr strict security', 0
    RECONFIGURE
END
GO

